import { Navigate, Outlet, Link } from "react-router-dom";
import { useAuth } from "../../providers/auth";

export const ProtectedLayout = () => {
  const { user } = useAuth();

  if (user) {
    return <Navigate to="/dashboard/profile" />;
  }

  return (
    <div>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/login">Login</Link>
      </nav>
      <Outlet />
    </div>
  )
};
